import React from 'react';

function Homepage() {
  return (
    <div>
      <h1>Welcome to Music Match</h1>

      <form action="/signup">
        <button>Sign up</button>
      </form>
      <form action="/login">
        <button>Log In</button>
      </form>
    </div >
  );
}

export default Homepage;
